const Card = () => (
    <div className="card">
        <div className="cardHeader">
            <div className="container">
                <div className="avatar"></div>
            </div>
        </div>
        <div className="headerBackground">
        </div>
        <div className="infos">
            <div className="container">
                Titulo
                <div className="subTitulo">Sub Titulo</div>
                <div className="reactions"></div>

            </div>
        </div>
    </div>
);

export default Card;
